class Queue::Node {
    public:
        int item;
        Node * next;

        Node(int x) {
            item = x;
            next = nullptr;
        }
};


Queue::Queue() {
    Front = nullptr, End = nullptr;
}

Queue::~Queue() {
    deallocate();
}

int Queue::size() {
    Node * cursor = Front;
    int size = 0;

    while(cursor!= nullptr)
    {
        size++;
        cursor = cursor -> next;
    }
    return size;

}

void Queue::enqueue(int x) {
    Node * newNode = new Node (x);
    if (End == nullptr) {
        Front = newNode;
        End = newNode;
    }
    else {
        End->next = newNode;
        End = newNode;
    }
}

