# Detailed transaction model (SDK v4)

This article explains the Detailed transaction model.

A [transaction](../sdk/transactions.md) is an atomic group of operations that represent the atomic behaviour of a blockchain, such as creating an account, transferring funds from one account to another, or executing a smart contract. In the model of the Detailed transaction (DTE), the same operation (for example, creating account) has its own transaction record in the DTE and its transactions in the DTE are grouped together in a single transaction record. This prevents the DTE from making too many unnecessary API calls and to optimize for the network.

