	config, req *Request, logger logger.Option,
) (Config, error) {
	if config.ConfigSource == nil {
		return config, nil
	}

	switch req.ConfigSource {
	case ConfigSourceEnv:
		return envConfigFromRequest(config.ConfigSource, req, logger)
	case ConfigSourceConfig:
		return configFromConfig(config.ConfigSource, config, req, logger)
	}
	return config, nil
