class Solution {
 public:
  ListNode* reverseList(ListNode* head) {
    if (!head) {
      return nullptr;
    }
    ListNode* prev = nullptr;
    ListNode* cur = head;
    while (cur->next) {
      ListNode* tmp = cur->next;
      cur->next = prev;
      prev = cur;
      cur = tmp;
    }
    cur->next = prev;
    return cur;
  }
};

