func (c *Cluster) GetNodes() []*Node {
	sort.Slice(c.Nodes, func(i, j int) bool {
		if c.Nodes[i].Name < c.Nodes[j].Name {
			return true
		} else if c.Nodes[i].Name > c.Nodes[j].Name {
			return false
		} else {
			return c.Nodes[i].ID < c.Nodes[j].ID
		}
	})

	return c.Nodes
